import React, { useState } from 'react';

let count = 1;

const state = useState();
const Inc = () => {
    console.log('click');
}

const App = () => {
    return (
    <>
    <h1> {count} </h1>
    <button onClick={Inc}> Click Me</button>
    </>
    );
};

export default App;
